import React from 'react';

const PrintButton = () => {

  const handlePrint = () => {
    const content = document.getElementById('order-content'); // replace with your content id
    window.print(content);
  }

  return (
    <button onClick={handlePrint}>Print Order</button>
  );
}

export default PrintButton;
